import React, { Component } from "react"
import { slide as Menu } from 'react-burger-menu'

class UseTemplate extends Component{
    showSettings(event){
        event.preventDefault();
    }

    render() {
        return (
            <Menu>
                <a id={"defaultTemplates"} className={"templateMenu"}>Default Templates</a>
                <a id={"myTemplates"} className={"templateMenu"}>My Templates</a>
                <a onClick={this.showSettings} className={"templateMenuIcon"}>Templates</a>
            </Menu>
        )
    }
}

export default UseTemplate
